import { ClanData } from '../api'
import { Button } from "shards-react";

function filterMember(key) {
  return true
}

const HomePage = (props) => (
  <>
    <h1>Clan Details</h1>
    <Button>Primary</Button>
    <div>
      {props.clanData.memberList.map((member, i) => {
        return (
          <ul key={i}>
            <li>{member.clanRank}</li>
            <li>{member.name}</li>
            <li>{member.expLevel}</li>
            <li>{member.trophies}</li>
            <li>{member.donations}</li>
            <li>{member.donationsRecieved}</li>
          </ul>
        )
      })}
    </div>
    {JSON.stringify(props.clanData)}
  </>
)

HomePage.getInitialProps = async function() {
  const clanData = await ClanData()
  return { clanData }
}

export default HomePage
